import { View, Text } from 'react-native'
import React from 'react'
import { HeaderSearchBar, HeaderClassicSearchBar } from "react-native-header-search-bar";

const SearchBar = () => {
  return (
    <View>
      <Text>Hello</Text>
    </View>
  )
}


export default SearchBar;
